import React from 'react';
//import {Link} from 'react-router-dom';
import './Header.css';

class Header extends React.Component{
    render() {
        return (
            <div className="container-fluid">
              <nav class="navbar navbar-expand-sm bg-dark navbar-dark fixed-top navmain">
              <a class="navbar-brand" href="# ">Logo</a>
              <ul class="navbar-nav">
                <li class="nav-item">
                  <a class="nav-link" href="# ">Map</a>
                </li>
                <li class="nav-item">
                  <a class="nav-link" href="# ">Graph</a>
                </li>
                <li class="nav-item">
                  <a class="nav-link" href="#">Alert</a>
                </li>
                <li class="nav-item">
                  <a class="nav-link" href="#">Add User</a>
                </li>
                <li class="nav-item">
                  <button class="nav-link" className="btn btn-primary loginbutton" href="#">Login</button>
                </li>
              </ul>
            </nav>
            </div> 
        );
    }
}
export default Header;
